var querium = {
    buildDate: "Oct 19, 2017",

    // Global configuration parameters
    appID: null,
    student: null,
    options: null,
    callbacks: null,
    serverURL: null,

    startQuestion: function () {
        // NOTE: arguments are pulled from the special arguments psuedo-array
        /*
            In a webapp the questions are all -typically- displayed in a single
            querium element. The webapp controls the entire experience outside of
            the querium element including question selection, saving work in
            progress, abandon, next, previous, etc.

            driven signature
                appID, student, question, callbacks, options, target
            driven arguments
                appID - the UUID assigned to the vendor/publisher by Querium
                student - a unique ID (can be obfuscated/RNG) for the student
                question - an object defining the question to be worked
                callbacks - an object defining callbacks in the webapp
                options - an object containing options
                target -  a valid CSS selector targeting a <querium> element (optional)
        */

        /*
            In an ePub the questions are inlined in the xHMTL and are fixed within
            the content of the ePub. The StepWise icon for Example 4.2.2 will be
            next to the corresponding discussion setup up Example 4.2.2.
            The inline version of startProblem allows a sophisticated ePub
            developer to dynamically instantiate the querium element and
            then tell it to execute with startProblem.
            For ePubs, brevity in definining the question is important so it
            relies on globals defined within the page.

            inline  signature
                target
            inline arguments
                target -  a valid CSS selector targeting a <querium> element (required)
        */

        var target; // the querium element to target
        var fail = false; // if not false, contains a message to return on exit

        var appID;
        var student;
        var question;
        var callbacks;
        var options;

        switch (arguments.length) {

        case 0: // inline using first querium element (e.g., startQuestion() )

            target = document.querySelector('querium');

            // is there a querium object
            if (target === null) {
                fail = "querium.startQuestion() - No <querium> elements found";
                break;
            }

            // check element for required attributes
            if (target.getAttribute('type') === null || !target.getAttribute('type').length) {
                fail = "querium.startQuestion() - no type attribute provided";
                break;
            }
            if (target.getAttribute('definition') === null || !target.getAttribute('definition').length) {
                fail = "querium.startQuestion() - no definition attribute provided";
                break;
            }

            angular.element(target).isolateScope().startProblem();
            break;

        case 1: // inline using specified querium element
            target = document.querySelector(arguments[0]);

            // is there a querium object
            if (target === null || target.tagName != "QUERIUM") {
                fail = "querium.startQuestion() - No <querium> element for " + arguments[0] + " found";
                break;
            }

            if (target.getAttribute('type') === null || !target.getAttribute('type').length) {
                fail = "querium.startQuestion() - no type attribute provided";
                break;
            }

            if (target.getAttribute('definition') === null || !target.getAttribute('definition').length) {
                fail = "querium.startQuestion() - no definition attribute provided";
                break;
            }

            angular.element(target).isolateScope().startProblem();
            break;

        case 3: // driven using first querium element - SHORT FORM

            // is there a querium object
            target = document.querySelector('querium');
            if (target === null) {
                fail = "querium.startQuestion() - No <querium> elements found";
                break;
            }

            appID = arguments[0];
            student = arguments[1];
            question = arguments[2];

            if (appID === undefined || !appID.length) {
                alert("querium.startQuestion - No appID provided");
                return;
            }
            if (student === undefined || !student.length) {
                alert("querium.startQuestion - No student provided");
                return;
            }
            if (question === undefined || typeof question != 'object') {
                alert("querium.startQuestion - No question provided");
                return;
            }

            angular.element(target).isolateScope().startProblem(appID, student, question);
            break;

        default: // driven with arguments - LONG FORM
            if (arguments.length < 5) {
                alert("querium.startQuestion - Missing arguments");
                return;
            }

            appID = arguments[0];
            student = arguments[1];
            question = arguments[2];
            callbacks = arguments[3];
            options = arguments[4];
            target = (arguments.length === 6 ? arguments[5] : 'querium');

            if (student === undefined || !student.length) {
                alert("querium.startQuestion - No student provided");
                return;
            }

            if (question === undefined || typeof question != 'object') {
                alert("querium.startQuestion - No question provided");
                return;
            } else {
                if (question.type === undefined || question.definition === undefined) {
                    alert("querium.startQuestion - No question type and/or definition provided");
                    return;
                }
            }

            if (callbacks === undefined || typeof callbacks != 'object') {
                alert("querium.startQuestion - No callback object provided");
                return;
            }

            if (options === undefined || typeof options != 'object') {
                alert("querium.startQuestion - No options object provided");
                return;
            }

            // is there a querium object
            target = document.querySelector(target);
            if (target === null || target.tagName !== "QUERIUM") {
                fail = "querium.startQuestion() - No <querium> element for " + target + " found";
                break;
            }

            angular.element(target).isolateScope().startProblem(appID, student, question, callbacks, options);
        }

        if (fail) {
            alert(fail);
            return;
        }
    },

    assessSolution: function (param1, param2) {
        var target = null,
            callback = null;

        // determine target (a string) and callback (a function)
        if (typeof param1 == 'string') { // it's targeting an element
            target = param1;
            if (typeof param2 == 'function') { // and param2 is the callback
                callback = param2;
            }
        } else if (typeof param1 == 'function') {
            callback = param1;
            if (typeof param2 == 'string') {
                target = param2;
            }
        }

        target = (typeof target != 'string' ? 'querium' : target);
        target = document.querySelector(target);
        if (target === null || target.tagName !== "QUERIUM") {
            return "querium.assessSolution() - No <querium> element for " + target + " found";
        }

        return angular.element(target).isolateScope().assessSolution(callback);
    },

    saveState: function (target) {
        // is there a querium object
        target = (typeof target === 'undefined' ? 'querium' : target);
        target = document.querySelector(target);
        if (target === null || target.tagName !== "QUERIUM") {
            return "querium.saveState() - No <querium> element for " + target + " found";
        }

        return angular.element(target).isolateScope().saveState();
    }
};

