qqQuillboard.directive('quillSpecialKey', function () {
    return {
        restrict: "E",
        templateUrl: 'qq-directives/qq-quillspecialkey.tpl.html',
        replace: true,
        link: function (scope, ele, attr) {
            //console.dir(attr);
            //console.dir(scope);
            //console.dir(attr);

            // base64 background images can't be set via classes or styles
            if (scope.op.symbol_img) {
                // use a timeout to let Angular finish instantiating the DOM
                setTimeout(function () {
                    // ele[0].querySelector('div').style.backgroundImage = 'url(' + scope.op.symbol_img + ')';
                    ele[0].querySelector('img').setAttribute('src', scope.op.symbol_img);
                    ele[0].querySelector('div').classList.add("qq-qs-button");
                }, 0);
            }

            scope.doIt = function (e) {
                // if rightclicked, punt
                if (e.button == 2) {
                    return;
                }

                switch (scope.op.operator) {
                case "Backspace":
                    scope.api.keystroke(e, 'Backspace');
                    break;
                case "Clear":
                    scope.api.latex(e, '');
                    break;
                case "Space":
                    scope.api.typedText(' ');
                    break;
                case "Equals":
                    scope.api.write('=');
                    break;
                }
            };
        }
    };
});
